import React from 'react';
import {Table} from "react-bootstrap";

export default class QBData extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getInventory', {method: 'GET'})
            .then(res => res.json())
            .then(items=>this.setState({items}))
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }
    render() {
        const {items} = this.state;
        let itemArray = new Array(items.length);
        let i = 0;
        for(var key in items){
        itemArray[i] = items[key];
        i = i + 1;
        }

        const names = [];
        //const itemNames = [];

        function f() {
            for(var x in itemArray[2]){
                var temp = itemArray[2][x];
                names[x] = temp;
            }
            return (
                names.map((names, index) => (
                    <div style={{marginLeft:'500px', marginTop:'0px'}} key={index}>{names}</div>
                ))
            );
        }

        function y() {
            for(var x in itemArray[0]){
                var temp = itemArray[0][x];
                names[x] = temp;
            }
            return (
                names.map((names) => (
                    <div style={{marginLeft:'900px'}} key={names}>{names}</div>
                ))
            );
        }



        return (
            <>
                {y()}
                {f()}

                <div style={{marginTop: '20px', marginLeft: '265px', width: '1100px', height: '400px'}}>
                    <Table striped bordered hover variant={"dark"} layout={"true"}>
                        <thead>
                        <tr>
                            <th>Name #</th>
                            <th>Description</th>
                        </tr>
                        </thead>
                        <tbody>
                        <tr>
                            <td>{f()}</td>
                            <td>{y()}</td>
                        </tr>
                        </tbody>
                    </Table>
                </div>

            </>


        );

    }
}
